static const uint8_t LARGE_FONT_SIZE = 20;
static const uint8_t LARGE_FONT_BYTES_PER_CHAR = 3;

static uint8_t get_char_idx_and_go_next(uint8_t** text) {
    uint8_t cur = (*text)[0];
    *text += 1;
    if(cur < 128 || cur == SMALL_FONT_TRIANGLE[0]) {
        return cur;
    } else if(cur < 192) {
        // utf8 byte middle, should not happen
        return '?';
    } else if(cur < 224) {
        // two bytes utf8
        uint8_t cur2 = (*text)[0];
        if(cur2 == 0) {
            return 0;
        } else if(cur2 < 128 || cur2 >= 192) {
            return '?';
        }
        *text += 1;

        uint16_t codepoint = (cur - 192) * 64 + (cur2 - 128);
        if (codepoint >= 0x0410 && codepoint <= 0x044F) {
            return 128 + codepoint - 0x410;
        } else if (codepoint == 0x401) {
            return 192;
        } else if (codepoint == 0x451) {
            return 193;
        } else if (codepoint == 0xa0) {
            return ' '; // Instead of non-braking space
        } else if (codepoint == 0xab || codepoint == 0xbb) {
            return '"';
        } else {
            return '?';
        }
    } else if(cur < 240) {
        // three bytes utf8
        uint8_t cur2 = (*text)[0];
        if(cur2 == 0) {
            return 0;
        } else if(cur2 < 128 || cur2 >= 192) {
            return '?';
        }
        *text += 1;

        uint8_t cur3 = (*text)[0];
        if(cur3 == 0) {
            return 0;
        } else if(cur3 < 128 || cur3 >= 192) {
            return '?';
        }
        *text += 1;

        uint16_t codepoint = (cur - 224) * 64 * 64 + (cur2 - 128) * 64 + (cur3 - 128);
        if (codepoint == 0x2013) {
            return '-'; // Instead of dash
        } else {
            return '?';
        }
    } else {
        // we do not support the rest of utf8 standard
        return '?';
    }
}

